import React from "react";

export default function MainWindow(props) {
  const 
       title = props.title,
       data = props.season_leaders_players
    //    data = async()=> {return await props.season_leaders_players}
 
  return (
    <section>
        <h2>{title}</h2>    
        {data.then(function(f){console.log(f )})}
    </section>
  );
}

